import React, { Component } from 'react';
import LinkButton from '../Components/LinkButton';
import PrimaryButton from '../Components/PrimaryButton';
import SecondaryButton from '../Components/SecondaryButton';
import './ComponentLibrary.css';

const onPrimaryButtonClick = () => {
    console.log("Primary button clicked");
}

const onSecondaryButtonClick = () => {
    console.log("Secondary button clicked");
}

const onLinkButtonClick = () => {
    console.log("Link button clicked");
}

class ComponentLibrary extends Component {
    render() {
        return (
            <>
                <div className='fontWeight'>
                    <p className='light'>Light - 300</p>
                    <p className='regular'>Regular - 400</p>
                    <p className='medium'>Medium - 500</p>
                    <p className='semibold'>SemiBold - 600</p>
                    <p className='bold'>Bold - 700</p>
                </div>
                <div className='typography'>
                    <h1 className='h1'>H1</h1>
                    <h2 className='h2'>H2</h2>
                    <h3 className='h3'>H3</h3>
                    <h4 className='h4'>H4</h4>
                    <h5 className='h5'>H5</h5>
                    <h6 className='h6'>H6</h6>
                    <p className='subtitle1'>Subtitle 1</p>
                    <p className='subtitle2'>Subtitle 2</p>
                    <p className='body1'>Body 1</p>
                    <p className='body2'>Body 2</p>
                    <p className='button'>Button</p>
                </div>
                <div className='colors'>
                    <div className='background'>
                        <p>Background</p>
                        <p>#283740</p>
                    </div>
                    <div className='primary'>
                        <p>Primary</p>
                        <p>#94B6C2</p>
                    </div>
                    <div className='secondary'>
                        <p>Secondary</p>
                        <p>#B8B08C</p>
                    </div>
                    <div className='error'>
                        <p>Error</p>
                        <p>#BB9390</p>
                    </div>
                </div>
                <div className='layout-container'>
                    <PrimaryButton
                        text="Primary Button"
                        className="primaryButton"
                        onClick={onPrimaryButtonClick}
                    />
                    <SecondaryButton
                        text="Secondary Button"
                        className="secondaryButton"
                        onClick={onSecondaryButtonClick}
                    />
                    <LinkButton
                        text="Link Button"
                        className="linkButton"
                        onClick={onLinkButtonClick}
                    />
                </div>
            </>
        );
    }
}

export default ComponentLibrary;
